function doStuff() {
    document.getElementById("tbody").innerHTML = "";

    res.split(",]\n").forEach((z) => {
        if (z === "") {
            return;
        }
        let p = z.split(":[")[1]

        let algs = p.split(",")

        row = tbody.insertRow();

        let img = new Image();
        img.src = "http://cube.rider.biz/visualcube.php?fmt=svg&size=150&pzl=2&case=" + algs[0];

        row.insertCell().appendChild(img);

        let string1 = "";
        let string2 = "";

        for (let i = 0; i < algs.length; i++) {
            if (i < algs.length / 2) {
                string1 += algs[i] + "\n";
            } else {
                string2 += algs[i] + "\n";
            }
        }

        row.insertCell().innerText = string1;
        row.insertCell().innerText = string2;
    })
}

